"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Skin warts (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/skin-warts-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H483559997\">",
"      <span class=\"h1\">",
"       What do skin warts look like?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Skin warts are raised round or oval growths. They can be lighter or darker than the skin around them. Some warts have tiny black dots in them, often called seeds. Warts can appear alone or in groups that join and form patches.",
"     </p>",
"     <p>",
"      Different types of warts affect different parts of the body:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Common skin warts can show up anywhere on the skin but most often affect the fingers, hands, knees, and elbows (",
"        <a class=\"graphic graphic_picture graphicRef78884 \" href=\"UTD.htm?9/17/9488\">",
"         picture 1",
"        </a>",
"        ).",
"       </li>",
"       <li>",
"        When common warts are found around the fingernails, they are called &ldquo;periungual&rdquo; warts (",
"        <a class=\"graphic graphic_picture graphicRef62677 \" href=\"UTD.htm?25/54/26478\">",
"         picture 2",
"        </a>",
"        ).",
"       </li>",
"       <li>",
"        Plantar warts are found on the soles (bottoms) of the feet (",
"        <a class=\"graphic graphic_picture graphicRef67490 \" href=\"UTD.htm?13/36/13891\">",
"         picture 3",
"        </a>",
"        ).",
"       </li>",
"       <li>",
"        Flat warts are usually found on the back of the hands, face, and lower legs (",
"        <a class=\"graphic graphic_picture graphicRef78653 \" href=\"UTD.htm?19/47/20211\">",
"         picture 4",
"        </a>",
"        ).",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H483560004\">",
"      <span class=\"h1\">",
"       What causes skin warts?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most warts are caused by germs called viruses. You can get infected with the virus that causes warts by touching another person's wart. You can also get infected by touching objects that have the virus on them. For instance, people can catch warts by walking barefoot around pools, locker rooms, or gyms.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H483560011\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse about my wart?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You should see a doctor or nurse if:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        You are not sure that what you have is a wart",
"       </li>",
"       <li>",
"        Your wart does not go away with home treatment",
"       </li>",
"       <li>",
"        You would like to use home treatment, but are not sure which treatment is right for you",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H483560018\">",
"      <span class=\"h1\">",
"       What are the home treatments for warts?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There are a few home treatments to choose from. Most take weeks or even months to work. Warts can come back after treatment.",
"     </p>",
"     <p>",
"      Not everyone needs treatment for warts. Some warts go away on their own within 2 years. But warts can also get bigger or spread, so many people decide to treat their warts. &nbsp;",
"     </p>",
"     <p>",
"      Here are the home treatment options (which you can use together, if you want):",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Salicylic acid",
"        </strong>",
"        &ndash; Salicylic acid is a mild acid that you put on warts. It is sold in drugstores and comes in different forms, such as a liquid or patch. If you decide to try salicylic acid, follow the directions on the label. But do not use this treatment if you have a form of nerve damage called &ldquo;neuropathy.&rdquo;",
"       </li>",
"       <li>",
"        <strong>",
"         Duct tape",
"        </strong>",
"        &ndash; It sounds strange, but some people find that their warts go away if they cover them with duct tape for a while. You can buy duct tape at most home improvement stores. If you want to try it on your warts, buy the silver tape, not the clear. The silver tape stays on better.",
"        <br/>",
"        <br/>",
"        Here is what you should do:",
"        <br/>",
"        <br/>",
"        1. Cover the wart with tape and leave the tape on for 6 days.",
"        <br/>",
"        2. Remove the tape and soak the skin in warm water for 10 to 20 minutes.",
"        <br/>",
"        3. Use an emery board or pumice stone to gently scrape the dead skin off the wart.",
"        <br/>",
"        4. Leave the skin uncovered for 1 night.",
"        <br/>",
"        5. Apply the tape for another 6 days.",
"        <br/>",
"        <br/>",
"        If you do not see some improvement within 2 weeks, the tape is probably not going to work. But if it does seem to be working, you can use the tape for another 2 weeks.",
"        <br/>",
"        <br/>",
"        Do not try duct tape on warts if you have diabetes, nerve damage (neuropathy), diseased arteries in the legs (peripheral artery disease), or any condition that makes your skin sensitive. If you have any of these conditions, duct tape can cause problems, such as skin sores or infection.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H483560039\">",
"      <span class=\"h1\">",
"       How do doctors and nurses treat warts?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Doctors and nurses have a few ways to treat warts. They often suggest combining the treatments they use with at-home treatments, like salicylic acid.",
"     </p>",
"     <p>",
"      The doctor or nurse can:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Freeze the wart off with a special fluid that gets very cold (called liquid nitrogen)",
"       </li>",
"       <li>",
"        Treat the wart with a medicine called",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?8/44/8899?source=see_link\">",
"         cantharidin",
"        </a>",
"        that destroys warts. This treatment is not painful at first, but it sometimes causes pain, blisters, and swelling shortly after use.",
"       </li>",
"       <li>",
"        Shave the wart off with a knife (after numbing the skin)",
"       </li>",
"       <li>",
"        Prescribe a skin cream that helps the body get rid of warts",
"       </li>",
"       <li>",
"        Inject the wart with a medicine that helps the body fight the virus that causes warts",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If you have one of these treatments, ask your doctor or nurse what to expect after treatment. That way, if your skin starts to hurt or turns red you will know if it is normal. But if your skin starts to form pus, you should call your doctor or nurse right away.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H483560046\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?25/16/25857?source=see_link\">",
"       Patient information: Skin warts (Beyond the Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?0/52/834?source=see_link\">",
"       Patient information: Corns and calluses (The Basics)",
"      </a>",
"     </p>",
