" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 550px\">",
"   <div class=\"ttl\">",
"    Car seat for preterm infant",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 530px; height: 425px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A) Car seat with a distance of 5 1/2 in (14 cm) or less from the crotch strap to the seat back and 10 in (24.5 cm) or less from the lower harness strap to the seat bottom. B) The preterm infant should be positioned with his/her buttocks and back flat against the back of the car safety seat. Car inserts are placed on both sides of the infant to provide lateral support for the head and neck. The shoulder straps are at the lowest slots ensuring that the shoulders are above the slots. The harness should fit snugly and the retainer clip positioned on the infant's chest.",
