var title_f11_5_11356="Criteria for probable VaD";
var content_f11_5_11356=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F67333&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F67333&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    NINDS-AIREN criteria for probable vascular dementia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        The criteria for the clinical diagnosis of probable vascular dementia include all of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Dementia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Defined by cognitive decline from a previously higher level of",
"functioning and manifested by impairment of memory and of two or more",
"cognitive domains (orientation, attention, language, visuospatial",
"functions, executive functions, motor control, and praxis), preferably",
"established by clinical examination and documented by",
"neuropsychological testing; deficits should be severe enough to",
"interfere with activities of daily living not due to physical effects",
"of stroke alone.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <strong>",
"         Exclusion criteria:",
"        </strong>",
"        Cases",
"with disturbance of consciousness, delirium, psychosis, severe aphasia,",
"or major sensorimotor impairment precluding neuropsychological testing.",
"Also excluded are systemic disorders or other brain diseases (such as",
"AD) that in and of themselves could account for deficits in memory and",
"cognition.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Cerebrovascular disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Defined by the presence of focal signs on neurologic examination,",
"such as hemiparesis, lower facial weakness, Babinski sign, sensory",
"deficit, hemianopia, and dysarthria consistent with stroke (with or",
"without history of stroke), and evidence of relevant CVD by brain",
"imaging (CT or MRI) including multiple large vessel infarcts or a",
"single strategically placed infarct (angular gyrus, thalamus, basal",
"forebrain, or PCA or ACA territories), as well as multiple basal",
"ganglia and white matter lacunes, or extensive periventricular white",
"matter lesions, or combinations thereof.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        A relationship between the above two disorders",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Manifested or inferred by the presence of one or more of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        (a) onset of dementia within three months following a recognized stroke;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        (b) abrupt deterioration in cognitive functions; or fluctuating, stepwise progression of cognitive deficits.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
