var title_f11_5_11358="Studies of supplemental oxygen for dyspnea in advanced cancer";
var content_f11_5_11358=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F51877&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F51877&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Studies of supplemental oxygen for dyspnea in advanced cancer",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"6\" width=\"16%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Study",
"       </td>",
"       <td class=\"subtitle1\">",
"        Design",
"       </td>",
"       <td class=\"subtitle1\">",
"        Patients",
"       </td>",
"       <td class=\"subtitle1\">",
"        Intervention",
"       </td>",
"       <td class=\"subtitle1\">",
"        Measurement",
"       </td>",
"       <td class=\"subtitle1\">",
"        Results",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"6\">",
"        Hypoxemic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Bruera 1992",
"        <sup>",
"         [1]",
"        </sup>",
"       </td>",
"       <td>",
"        RDB, crossover",
"       </td>",
"       <td>",
"        n = 1, six trials of O",
"        <sub>",
"         2",
"        </sub>",
"        versus air",
"       </td>",
"       <td>",
"        5 L/min O",
"        <sub>",
"         2",
"        </sub>",
"        versus 5 L/min air for five mins",
"       </td>",
"       <td>",
"        - VAS",
"       </td>",
"       <td>",
"        - Significant improvement in VAS of O",
"        <sub>",
"         2",
"        </sub>",
"        over air. Both patient and investigator chose O",
"        <sub>",
"         2",
"        </sub>",
"        over air in five of six cases.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Bruera 1993",
"        <sup>",
"         [2]",
"        </sup>",
"       </td>",
"       <td>",
"        RDB, crossover",
"       </td>",
"       <td>",
"        n = 14, inpatients",
"       </td>",
"       <td>",
"        100 percent O",
"        <sub>",
"         2",
"        </sub>",
"        versus air at 5 L/min by nasal prongs at rest till SaO",
"        <sub>",
"         2",
"        </sub>",
"        stable for five min",
"       </td>",
"       <td>",
"        <p>",
"         - VAS",
"        </p>",
"        <p>",
"         - Degree of benefit (Likert scale)",
"        </p>",
"        <p>",
"         - Patient preference",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         - Significant improvement from baseline in VAS dyspnea scores with O",
"         <sub>",
"          2",
"         </sub>",
"         , but not with air",
"        </p>",
"        <p>",
"         - 12 of 14 patients prefer O",
"         <sub>",
"          2",
"         </sub>",
"         ; 12 of 14 patients rate degree of benefit with O",
"         <sub>",
"          2",
"         </sub>",
"         as moderate or greater",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"6\">",
"        Combined hypoxemic and non-hypoxemic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Booth 1996",
"        <sup>",
"         [3]",
"        </sup>",
"       </td>",
"       <td>",
"        Randomized, single-blind, crossover",
"       </td>",
"       <td>",
"        n = 45, inpatients, baseline SaO",
"        <sub>",
"         2",
"        </sub>",
"        range 80 to 99 percent",
"       </td>",
"       <td>",
"        100 percent O",
"        <sub>",
"         2",
"        </sub>",
"        versus air at 4 L/min by nasal prongs for 15 min at rest",
"       </td>",
"       <td>",
"        - VAS",
"       </td>",
"       <td>",
"        <p>",
"         - Both O",
"         <sub>",
"          2",
"         </sub>",
"         and air resulted in significant improvement from baseline, no statistical difference in magnitude of improvement between groups",
"        </p>",
"        <p>",
"         - Neither baseline oxygen saturation (SpO",
"         <sub>",
"          2",
"         </sub>",
"         ), lung disease nor cardiac status predicted greater improvement with O",
"         <sub>",
"          2",
"         </sub>",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Philip 2006",
"        <sup>",
"         [4]",
"        </sup>",
"       </td>",
"       <td>",
"        RDB, crossover",
"       </td>",
"       <td>",
"        n = 51, inpatients and outpatients, baseline SaO",
"        <sub>",
"         2",
"        </sub>",
"        range 70 to 98 percent",
"       </td>",
"       <td>",
"        100 percent O",
"        <sub>",
"         2",
"        </sub>",
"        versus air at 4 L/min for 15 min, then crossover to alternative",
"       </td>",
"       <td>",
"        <p>",
"         - Patient preference",
"        </p>",
"        <p>",
"         - VAS",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         - No patient preference for oxygen",
"        </p>",
"        <p>",
"         - No difference in change in dyspnea VAS",
"        </p>",
"        <p>",
"         - No correlation between O",
"         <sub>",
"          2",
"         </sub>",
"         saturation and VAS score",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"6\">",
"        Non-hypoxemic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Abernethy 2010",
"        <sup>",
"         [5]",
"        </sup>",
"       </td>",
"       <td>",
"        RDB, separate placebo control group",
"       </td>",
"       <td>",
"        n = 239, outpatient adults, mixed diagnoses, multicenter (nine sites in three countries)",
"       </td>",
"       <td>",
"        100 percent O",
"        <sub>",
"         2",
"        </sub>",
"        or room air at 2 L/min via nasal prongs for seven days",
"       </td>",
"       <td>",
"        <p>",
"         - Dyspnea NRS",
"        </p>",
"        <p>",
"         - Dyspnea diary",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         - No difference in breathlessness at any time",
"        </p>",
"        <p>",
"         - Similar proportions in both arms achieved &ge;1 point reduction on NRS",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Ahmedzai 2004",
"        <sup>",
"         [6]",
"        </sup>",
"       </td>",
"       <td>",
"        RDB, crossover",
"       </td>",
"       <td>",
"        n = 12, outpatients",
"       </td>",
"       <td>",
"        HeO",
"        <sub>",
"         2",
"        </sub>",
"        28 versus 28 percent O",
"        <sub>",
"         2",
"        </sub>",
"        versus air at 8 L/min by mask for duration of the six minute walk test",
"       </td>",
"       <td>",
"        <p>",
"         - Modified Borg scale",
"        </p>",
"        <p>",
"         - Distance walked",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         - HeO",
"         <sub>",
"          2",
"         </sub>",
"         28 &gt;28 percent O",
"         <sub>",
"          2",
"         </sub>",
"         &gt;air for distance walked",
"        </p>",
"        <p>",
"         - HeO",
"         <sub>",
"          2",
"         </sub>",
"         28 &gt;air for Borg scale at end of six minute walk",
"        </p>",
"        <p>",
"         - Borg scale for 28 percent O",
"         <sub>",
"          2",
"         </sub>",
"         was better than non-enriched air, but did not achieve statistical significance",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Bruera 2003",
"        <sup>",
"         [7]",
"        </sup>",
"       </td>",
"       <td>",
"        Randomized, single-blind, crossover",
"       </td>",
"       <td>",
"        n = 33, outpatients",
"       </td>",
"       <td>",
"        100 percent O",
"        <sub>",
"         2",
"        </sub>",
"        versus air at 5 L/min by nasal prongs for six minute walk test",
"       </td>",
"       <td>",
"        <p>",
"         - Dyspnea NRS",
"        </p>",
"        <p>",
"         - Fatigue NRS",
"        </p>",
"        <p>",
"         - Distance walked",
"        </p>",
"       </td>",
"       <td>",
"        - No difference in dyspnea, fatigue or distance walked",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     RDB: randomized double blind; VAS: visual analogue scale; NRS: numeric rating scale.",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br/>",
"     <ol>",
"      <li>",
"       Bruera E, Schoeller T, MacEachern T. Symptomatic benefit of supplemental oxygen in hypoxemic patients with terminal cancer: the use of the N of 1 randomized controlled trial. J Pain Symptom Manage 1992; 7:365.",
"      </li>",
"      <li>",
"       Bruera E, de Stoutz N, Velasco-Leiva A, et al. Effects of oxygen on dyspnoea in hypoxaemic terminal-cancer patients. Lancet 1993; 342:13.",
"      </li>",
"      <li>",
"       Booth S, Kelly MJ, Cox NP, et al. Does oxygen help dyspnea in patients with cancer? Am J Respir Crit Care Med 1996; 153:1515.",
"      </li>",
"      <li>",
"       Philip J, Gold M, Milner A, Di Iulio J, Miller B, Spruyt O. A randomized, double-blind, crossover trial of the effect of oxygen on dyspnea in patients with advanced cancer. J Pain Symptom Manage 2006; 32:541.",
"      </li>",
"      <li>",
"       Abernethy AP, McDonald CF, Frith PA, et al. Effect of palliative oxygen versus room air in relief of breathlessness in patients with refractory dyspnoea: A double-blind randomized, controlled trial. Lancet 2010; 376:784.",
"      </li>",
"      <li>",
"       Ahmedzai SH, Laude E, Robertson A, et al. A double-blind, randomised, controlled Phase II trial of Heliox28 gas mixture in lung cancer patients with dyspnoea on exertion. Br J Cancer 2004; 90:366.",
"      </li>",
"      <li>",
"       Bruera E, Sweeney C, Willey J, et al. A randomized controlled trial of supplemental oxygen versus air in cancer patients with dyspnea. Palliat Med 2003; 17:659.",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
